string getRatingLevel()
{
    string tm;
    switch (rating_score)
    {
        case ADULT:
        {
            tm = "Adult.";
            break;
        }
        case MODERATE:
        {
            tm = "Moderate.";
            break;
        }
        case GENERAL:
        {
            tm = "General.";
            break;
        }
    }
    return tm;
}

// create the text for the hud size dialog
string mk_hudsize()
{
    string ts = "Select Hud Size.\n\n\tCurrent Hud Size is ";
    switch (hud_size)
    {
        case SMALL:
        {    
            ts += "Small";
            break;
        }
        case MEDIUM:
        {    
            ts += "Medium";
            break;
        }
        case LARGE:
        {    
            ts += "Large";
            break;
        }
    }
    return ts += "\n";
}

// create the main menu text
string mk_menu()
{
    string tm = "Main Menu:\n\n\tTeleport Mode is ";

    if (hudFlags == AUTO)
        tm += "Auto";
    else
        tm += "Manual";

    tm += "\n\tSim Rating is ";

    switch (rating_score)
    {
        case ADULT:
        {
            tm += "Adult.";
            break;
        }
        case MODERATE:
        {
            tm += "Moderate.";
            break;
        }
        case GENERAL:
        {
            tm += "General.";
            break;
        }
    }

    tm += "\n\tCurrent Safe Zone is ";

    if(safe_zone_name != "")
        tm += safe_zone_name;
    else 
        tm += "WelcomeHub";

    return tm += "\n"; 
}


// replace single list entries with 
list replaceListEntry( list entry, string  replace, string with )
{
    integer  index = llListFindList(entry, (list) replace);
    DS("index = " + (string) index);
    if(index == -1)
        return entry;
    else
        return llListReplaceList(entry, (list) with, index, index);
}

