default
{
    state_entry()
    {

        // cache textures
        llSetTexture("119e28e5-1043-0dc0-864e-a403092a4c2a", 1);
        llSetTexture("1fb10f43-10c6-844e-fb94-a78dbc30ed9b", 1);
